        function dragStartRates(e) {
            if (e.type === 'touchstart') {
                initialXRates = e.touches[0].clientX - legendRates.offsetLeft;
                initialYRates = e.touches[0].clientY - legendRates.offsetTop;
            } else {
                initialXRates = e.clientX - legendRates.offsetLeft;
                initialYRates = e.clientY - legendRates.offsetTop;
            }

            if (e.target === legendRates) {
                activeRates = true;
            }
        }

        function dragStartCompetitors(e) {
            if (e.type === 'touchstart') {
                initialXCompetitors = e.touches[0].clientX - legendCompetitors.offsetLeft;
                initialYCompetitors = e.touches[0].clientY - legendCompetitors.offsetTop;

            }

            if (e.target === legendCompetitors) {
                activeCompetitors = true;
            }
        }

        function dragEnd(e) {
            initialXRates = currentXRates;
            initialYRates = currentYRates;
            initialXCompetitors = currentXCompetitors;
            initialYCompetitors = currentYCompetitors;

            activeRates = false;
            activeCompetitors = false;
        }

        function dragRates(e) {
            if (activeRates) {
                e.preventDefault();

                if (e.type === 'touchmove') {
                    currentXRates = e.touches[0].clientX - initialXRates;
                    currentYRates = e.touches[0].clientY - initialYRates;
                } else {

                    currentYRates = e.clientY - initialYRates;

                legendRates.style.top = yOffset;
            }
        }

                    currentXCompetitors = e.clientX - initialXCompetitors;
                    currentYCompetitors = e.clientY - initialYCompetitors;

                legendCompetitors.style.top = yOffset;
            }
        }
